Zonder waarschuwing verdwijnen miljoenen mensen over de hele wereld. 
De verdwijningen zorgen ervoor dat onbemande voertuigen verongelukken en uitbranden. 
Rellen en plunderingen beheersen de steden en er is niemand die kan helpen of antwoorden kan geven. 
