betekent dit dat hij zijn hysterische passagiers moet zien te kalmeren en 
zijn gehavende toestel ergens aan de grond moet zien te zetten. 
Tegelijkertijd probeert de beroemde journalist Buck Williams de situatie te begrijpen 
en voor Chloe Steele, de dochter van Ray, haar moeder en dochter terug te vinden.

